import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './Header';
import TinderCards from './TinderCards';

function App() {
  return (
    <div className="App">

      <Router>
        <Header />
        <Routes>
          <Route path='/home'>
            <TinderCards />
          </Route>
        </Routes>
      </Router>

    </div>
  );
}

export default App;
